import React, { useState, useEffect } from "react";

const Valikot = (props) => {
  const [maakunnat, setMaakunnat] = useState([props.maakunnat]);
  console.log("maakunnat:", maakunnat);

  Object.values(maakunnat).map((maakunta) => {
    console.log("maakunnat yksitellen:", maakunta);
  });

  useEffect(() => {
    console.log("tullaanko tänne ensin");
    setMaakunnat([props.maakunnat]);
  }, []);

  const lisaaPaikat = () => {
    let options = Object.values(maakunnat).map((maakunta) => {
      <option>{maakunta}</option>;
    });

    return options;
  };

  return (
    <div>
      <select className={"options"}>
        {setTimeout(() => {
          lisaaPaikat();
        }, 1000)}
      </select>
    </div>
  );
};

export default Valikot;
